		function openChart(evt, chartName)
		{
		    var i, x, chartlinks;
		    x = document.getElementsByClassName("chart");

		    for (i = 0; i < x.length; i++)
		    {
		        x[i].style.display = "none";
		    }

		    chartlinks = document.getElementsByClassName("chartlink");
		    for (i = 0; i < x.length; i++)
		    {
		        chartlinks[i].className = chartlinks[i].className.replace(" chart-hover", "");
		    }

		    document.getElementById(chartName).style.display = "block";
		    evt.currentTarget.className += " chart-hover";
		}
	</script>
